import ReactPlayer from "react-player/youtube";

const Video = () => {
  return (
    <div className="contenedor_video">
      <i class="far fa-times-circle" onClick={this.abrirModal}></i>
      <ReactPlayer
        url={"https://youtu.be/tHW2aOuaXBA"}
        width="100%"
        height="100%"
        // controls
        playing
        volume=".8"
        loop
        className="video"
      />
    </div>
  );
};

export default Video;
